  "fixed_xml": "<ITEM>\nIn dem Berichthaus ist annoch zu haben: <BIBL>\n<TITLE>Gespräch zwischen einem Flüchtigen Pater aus Rom und einem Clerico, worinnen die in der Offenbarung Johannis beschriebene Gesichter gründlich erklärt und der Zustand der Kirche Nenes Testaments deutlich gezeigt, auch mit Schriftstellen gründlich bewiesen wird; absonderlich; dass von An. 1715. bis 1748. die Babylonische Hure muss ausgerottet werden übrigc.</TITLE>\nErster Theil. Der Zweyte Theil enthaltet, das durch den H. Geist nunmehro eröffnete versiegelte Buch, wie der Engel dem Daniel im 12. Cap. gesagt hat, dass er dieses Buch versiegeln sollte bis auf die letzte Zeit, so wurden viele darüber kommen und grossen Verstand finden. Da nun anjetzo die letzte Zeit vorhanden, und nur noch wenige Jahre zu dieser ganzen Weissagung ihrer Erfüllung gehören, so soll allhier dem 8 geneiggeneisten Leser gezeiget werden : Erstlich die Weissagung Danielis, zweytens die Offenbahrung St. Johannis und dridtens das tausend jährige Reich. Der dridte Theil ist, ein neuer Brieff an die Ebräer darinnen gezeiget wird, die gottliche Schlag-Uhr, und was es nach derselben geschlagen habe; und zu welcher Zeit der grosse Gott im Römischen Reich die Sonne am Mittag will untergehen und das Land am hellen Tage wird finster werden lassen, Amos 8. v. 9. dahingegen es in denen Morgenländeren unter den Juden und Heyden Licht werden wird, Zachar. 14. v. 7. und wie viel Zeit noch übrig ehe der Abend der ganzen Welt kommt, da sich denn die Zeit mit der Ewigkeit verwechseln wird.</TITLE>\nDiese samtliche 3. Theile in <FORMAT>8vo.</FORMAT> kosten nicht mehr als <PRIZE>4. ü.</PRIZE>\n</BIBL>\n</ITEM>",
